import React from "react";

export default function Dashboard() {
  return (
    <div className="dashboard">
      <div className="cards">
        <div className="card">Patients: 120</div>
        <div className="card">Doctors: 30</div>
        <div className="card">Prescriptions: 500</div>
      </div>
    </div>
  );
}
